func TestSendPhotoService_Do(t *testing.T) {
	base.SetToken(tokenTest)
	service := new(services.SendPhotoService)
	service.TeleRepo = repositories.TelegramRepository{}
	service.Data = request.SendPhotoRequest{
		ChatId:                "433657762",
		Caption:               "Halooo Test photo",
		PhotoBase64Encode:     "data:image/png;base64,",
		ParseMode:             "",
		DisableWebPagePreview: false,
		DisableNotification:   false,
		ProtectContent:        false,
	}
	data := service.Do()

	if data.Status {
		println("success send photo:", data.Data.(response.SendPhotoResponse).Ok)
		println("description send photo:", data.Data.(response.SendPhotoResponse).Description)
	}
}
